    "description": "<p>An adversary may disable or modify cloud logging capabilities and integrations to limit what data is collected on their activities and avoid detection. Cloud environments allow for collection and analysis of audit and application logs that provide insight into what activities a user does within the environment. If an adversary has sufficient permissions, they can disable or modify logging to avoid detection of their activities.</p><p>For example, in AWS an adversary may disable CloudWatch/CloudTrail integrations prior to conducting further malicious activity.<span>[1]</span> They may alternatively tamper with logging functionality – for example, by removing any associated SNS topics, disabling multi-region logging, or disabling settings that validate and/or encrypt log files.<span>[2]</span><span>[3]</span> In Office 365, an adversary may disable logging on mail collection activities for specific users by using the <code>Set-MailboxAuditBypassAssociation</code> cmdlet, by disabling M365 Advanced Auditing for the user, or by downgrading the user’s license from an Enterprise E5 to an Enterprise E3 license.<span>[4]</span></p>",
