            "name": "Cloud Service Disable",
            "description": "<p>Monitor logs for API calls to disable logging. In AWS, monitor for: <code>StopLogging</code>, <code>UpdateTrail</code> <code>DeleteTrail</code>.<span>[7]</span> In GCP, monitor for: <code>google.logging.v2.ConfigServiceV2.UpdateSink</code> and <code>google.logging.v2.ConfigServiceV2.DeleteSink</code>.<span>[8]</span> In Azure, monitor for <code>az monitor diagnostic-settings update</code> and <code>az monitor diagnostic-settings delete</code>.<span>[9]</span> Additionally, a sudden loss of a log source may indicate that it has been disabled.</p>",
